import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Funds.css';

const Funds = ({ type }) => {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);

  useEffect(() => {
    const fetchResults = async () => {
      if (query.length < 3) {
        setResults([]);
        return;
      }

      try {
        const response = await axios.get(`https://api.sec-api.io/compensation/${query}?token=12a52247ed6936bd4370b68b388a3b36694cacac397ea679b2356e01bc171cc3`);
        const data = response.data;

        setResults([data]); // Since the response is a single object, put it in an array
      } catch (error) {
        console.error('There was an error fetching the data!', error);
        setResults([]); // Clear results on error
      }
    };

    fetchResults();
  }, [query]);

  return (
    <div className="search-container1">
      <h2>Search Funds</h2>
      <div className="search-input-container1">
        <input
          type="text"
          placeholder={`Search for a ${type}`}
          value={query}
          onChange={(e) => setQuery(e.target.value)}
        />
        <span className="search-icon1">&#x1F50D;</span> {/* Unicode for search icon */}
      </div>
      <div className="search-results1">
        {results.map((result, index) => (
          <div key={index} className="search-result1">
            <div className="row"><strong>ID:</strong> {result.id}</div>
            <div className="row"><strong>CIK:</strong> {result.cik}</div>
            <div className="row"><strong>Ticker:</strong> {result.ticker}</div>
            <div className="row"><strong>Name:</strong> {result.name}</div>
            <div className="row"><strong>Position:</strong> {result.position}</div>
            <div className="row"><strong>Year:</strong> {result.year}</div>
            <div className="row"><strong>Salary:</strong> {result.salary}</div>
            <div className="row"><strong>Bonus:</strong> {result.bonus}</div>
            <div className="row"><strong>Stock Awards:</strong> {result.stockAwards}</div>
            <div className="row"><strong>Option Awards:</strong> {result.optionAwards}</div>
            <div className="row"><strong>Non-Equity Incentive Compensation:</strong> {result.nonEquityIncentiveCompensation}</div>
            <div className="row"><strong>Change in Pension Value and Deferred Earnings:</strong> {result.changeInPensionValueAndDeferredEarnings}</div>
            <div className="row"><strong>Other Compensation:</strong> {result.otherCompensation}</div>
            <div className="row"><strong>Total:</strong> {result.total}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Funds;
